import React from 'react';

const Navigation = ({onRouteChange}) => {
	return (
		<nav style = {{display:'flex', justifyContent:'flex-end'}}>
			<p onClick = {()=> onRouteChange('signin')} className = 'f3 underline black dim pointer ma2'>
				Sign Out
			</p>
		</nav>
	);
}

export default Navigation;
